@import url('https://fonts.googleapis.com/css2?family=Noto+Sans+KR:wght@100;300;400;500;700;900&display=swap');

/* 기본 */
*{margin: 0; padding: 0;}
html, button{font-family: 'Noto Sans KR';color: #333;}

li, ul, ol, a{list-style: none; color: inherit; text-decoration: none;}
h1, h2, h3, h4, h5, h6{font-weight: normal; font-size: inherit;}
.img{position: relative;}
a{display: block;}
img{display: block; width: 100%; height: auto;}
button{background: none; border: none; display: block;}
$mainC: #0E0057;


/* 양식 통일용 */
h1{
    font-size: 36px; font-weight: bold;
    text-align: center;
    margin-bottom: 15px;
    text-transform: uppercase;
    }
.tab_list{
    margin-bottom: 30px;
    display: flex;
    justify-content: center;
    }
    
.tab_list label{
    width: 260px; height: 60px;
    text-align: center; line-height: 60px;
    font-size: 20px;
    
    background: none;
    border: 1px solid;
    border-color: $mainC;
    margin-right: 40px;

    &:last-child{margin-right: 0;}
    &:before{content: "#"; display: inline;}
}





/* scss mixin */

@mixin secWidth{
    width: 100%;
    min-width: 1320px;
    max-width: 1660px;
    margin: 0 auto;
    box-sizing: border-box; 
}
@mixin flexSB{display: flex; justify-content: space-between;}

section,.header_inner,.footer_inner{@include secWidth;}
section,.footer_inner{
    position: relative;
    padding: 80px 10px;
    box-sizing: border-box;
}



/********** header **********/
.header{
    position: fixed;
    z-index: 999;
    width: 100%;
    background: #fff;

    .header_inner{
        height: 100px;
        @include flexSB;
        align-items: center;
        color: #333;
        overflow: hidden;
        transition: .3s;

        &.scroll_down{height: 0;}
        &.scroll_up{height: 100px;}

        .logo{
            width: 140px;
            padding-left: 10px;
            padding-right: 120px;
            
            svg{
            fill: #333;
        }
    }

    .gnb>ul{
        display: flex;

        >li{
            box-sizing: border-box;
            height: 100px;
            padding: 0 20px;
            
            &:nth-child(3){
                padding-right: 40px;
            }
            &:nth-child(4){
                padding-left: 40px;
            }

            &:nth-child(3)>a::after{
                content: "";
                width: 1px; height: 40px;
                display: block;
                background-color: #ccc;
                position: absolute;
                right: -40px; top: 30px;

            }


            >a{
                position: relative;
                padding-top: 30px;
                line-height: 40px;
                font:{
                    size: 20px;
                    weight: bold;
                }

                border-bottom: 1px solid rgba(255,255,255,0);
                transition: .2s;
            }//a

            &:hover>a{border-bottom: 1px solid #333;}

            /* hovermenu */
            .gnb_hover{
                width: 100vw;
                position: absolute;
                z-index: 99;
                left: 0; top: 100px;
                background-color: #fff;
                display: none;

                &.hovered{
                    display: block;
                }

                a{
                    display: inline;
                    &:hover{
                        color: $mainC;
                        border-bottom: 1px solid $mainC;
                    }
                    
                    .img{overflow: hidden;
                        img{transition: .3s}
                    }
                }
                
                .gnb_brand>a:hover{
                    border-bottom: 0px;
                    img{
                        transform: scale(1.1)
                    }
                }
                

                >div{
                    @include secWidth;
                    @include flexSB;
                    padding-bottom: 30px;
                    box-sizing: border-box;

                    h4{font:{
                        size: 20px;
                        weight: bold;
                    }
                    margin-bottom: 20px;}

                    .new_bottom{
                        margin-top: 10px;
                        text-transform: uppercase;
                    }

                    >div{
                        width: 340px;
                        padding-left: 30px;
                        box-sizing: border-box;
                        line-height: 35px;
                        &:first-child{border-right: 1px solid #aaa;}
                    }

                    .gnb_center{
                        width: 980px;
                        @include flexSB;
                        padding-left: 0px;

                        >div{
                            width: 25%;
                            box-sizing: border-box;
                            padding-left: 30px;
                            border-right: 1px solid #aaa;
                        }
                    }/* gnb_center */
                    
                }/* /gnb_hover > div */
            
            .gnb_kids{
                justify-content: start;
                .gnb_center{width: 735px;
                >div{width: calc((100%)/3);
                &:last-child{border-right: none;}}
                }
            }/* .gnb_kids */

            .gnb_brand{
                a{
                    box-sizing: border-box;
                    padding: 30px 16px 50px;
                }

                p{
                    margin-top: 20px;
                    font-size: 20px;
                    text-align: center;
                }
            }/* gnb_brand */
            
            }/* gnb_hover */
        }/* li */
    }/* .gnb */

    .user_menu>ul{
        width: 270px;
        @include flexSB;


        span{
            width: 60px; height: 60px;
            line-height: 60px;
            text-align: center;
            font-size: 40px;
            color: #333;
        }}

    } //.header_inner

    .search{ 
        position: fixed;
        top: 0; left: 0;
        z-index: 9999;
        width: 100vw;
        height: 500px;
        background-color: #fff;
        display: none;

        .search_inner{
            width: 1100px;
            height: 500px;
            margin: 0 auto;

            .top{
                position: relative;
                height: 100px; 
                box-sizing: border-box;
                padding: 20px 0;

                
                input[type=search]{
                    width: 100%; height: 60px;
                    box-sizing: border-box;
                    padding: 10px 20px;
                    border-radius: 40px;
                    background-color: #eee;
                    border: none; outline: none;
                    font-size: 20px;
                }
                .close{
                    position: absolute;
                    left: 100%; top: 50%;
                    margin-left: 10px; margin-top: -12px;
                    cursor: pointer;
                }
                
                .search_submit{
                    position: absolute;
                    top: 30px; right: 10px;
                    span{font-size: 40px;}
                }
                ::-webkit-search-cancel-button{display: none;}

                
            }

            .bottom{
                @include flexSB();
                >div{width: calc(100%/3);
                    h4{font-size: 20px;font-weight: bold; margin-bottom: 20px;}
                    p{line-height: 35px;}
                }
                
            }

        }//search_inner
    }//search

    .bg_opacity{
        width: 100vw; height: 100vh;
        position: fixed;
        background-color: #000;
        z-index: 9;
        opacity: .5;
        display: none;
        
    }
}/* header */


//scroll effect
.header.top{
    background: none;
.header_inner{
    color: #fff;
    .logo svg{fill: #fff;}
    .gnb>ul>li>a{color: #fff;}
    
    & .gnb>li:nth-child(3)>a::after{background-color: #fff;}
    .user_menu span{
        width: 60px; height: 60px;
        line-height: 60px;
        text-align: center;
        font-size: 40px;
        color: #fff;
    }
}
}


/********** visual_main **********/
.visual_main{
    position: relative;
    overflow-x: hidden;

    .swiper-wrapper{
        width: 100vw; height: 100vh;
    }

    .swiper-button-prev{
        position: absolute;
        top: 50%; transform: translateY(-50%); left: 0;
